        [Test]
        public void NullOrEmptyArray_Success()
        {
            int[] arr = new int[0];
            var sol = new MaxConsecutiveOnes(arr);
            var result = sol.GetMaxConsecutiveOnes();

            Assert.AreEqual(0, result);
        }

